  true,\n\t\"url\": null,\n\t\"notes\": \"This database provides for government and
  contractor registration, solicitation posting, proposal submission, proposal evaluation
  and award posting for select procurements. It provides for the electronic posting
  in one central location of contract award documents that may be retrieved by contractors,
  internal finance and program staff, as well as the general public. The application's
  next generation will enable Contracting Officers to identify the acquisition type,
  make solicitations, and participate in the decision process and award and service
  contracts with the least amount of development, maintenance, and support of Information
  Technology personnel. When used to solicit offers, it accepts, and allows them to
  be reviewed and analyzed, financial and commercial proprietary information. Otherwise,
  it is a portal to a range of other web resources and is a repository of contract
  information that MARAD staff, contractors and the general public can access.\",\n\t\"license_title\":
